    been corrected on this amendment. The receipts on Line 17 are for voter file purchase
    payments. The prices paid for voter file purchases are established using comparable
    prices charged by other state party committees throughout the country on a per-record
    cost. The exact price paid to the Committee by each entity is determined by multiplying
    the per-record cost by the number of records provided in the file purchased.  The
    date of the Jefferson Jackson 2009 dinner (JJ 2009) was May 12, 2009. As the non-federal
    portion of the ratio increased, no transfer back to the Non-Federal account of
